import React from 'react';
import { StyleSheet, View, Text, Linking, TouchableOpacity } from 'react-native';
import { Header as HeaderRNE, Icon } from '@rneui/themed';

type HeaderComponentProps = {
  title: string;
};

export default function Header({ title }: HeaderComponentProps) {
  const docsNavigate = () => {
    // Inserir a URL apropriada para a documentação aqui
    Linking.openURL('https://example.com/docs');
  };

  const playgroundNavigate = () => {
    // Inserir a URL apropriada para o playground aqui
    Linking.openURL('https://example.com/playground');
  };

  return (
    <HeaderRNE
      leftComponent={{
        icon: 'menu',
        color: '#fff',
        onPress: () => {
          // Inserir a ação desejada para o ícone de menu à esquerda
        },
      }}
      rightComponent={
        <View style={styles.headerRight}>
          <TouchableOpacity onPress={docsNavigate}>
            <Icon name="description" color="white" />
          </TouchableOpacity>
          <TouchableOpacity style={{ marginLeft: 10 }} onPress={playgroundNavigate}>
            <Icon type="antdesign" name="rocket1" color="white" />
          </TouchableOpacity>
        </View>
      }
      centerComponent={{ text: title, style: styles.heading }}
      containerStyle={styles.headerContainer}
    />
  );
}

const styles = StyleSheet.create({
  headerContainer: {
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#397af8',
    marginBottom: 20,
    width: '100%',
    paddingVertical: 15,
  },
  heading: {
    color: 'white',
    fontSize: 22,
    fontWeight: 'bold',
  },
  headerRight: {
    flexDirection: 'row',
    alignItems: 'center',
  },
});
